import React from 'react'

class Main extends React.Component{
    render(){
        return(
            <div className='Main'>
                {this.props.data.map(item=>{
                    <div className='contact'>
                        <h1>{item.name}</h1>
                        <h1>{item.street}</h1>
                        <h1>{item.city}</h1>
                        <h1>{item.eMail}</h1>
                    </div>
                })}
            </div>
        )
    }
}

export default Main
